import React from 'react';
import Typed from 'react-typed';

function Header() {
  return (
    <div>
        <h1>What am I?</h1>
        <Typed 
            strings={[
               "I'm a Full-Stack Web Developer",
               'A Baltimore Ravens Fan',
             'A Front-end developer',
                'A Backe-end developer']}
              typeSpeed={40}
              backSpeed={50}
              loop
        />
    </div>
  )
}

export default Header
